import React from 'react';

const Header = () => {
  return (
    <div
      style={{
        display: 'flex',
        height: '70px',
        width: '100%',

        position: 'fixed',
        left: 0,
        top: 0,

        backgroundColor: 'red',
      }}
    >
      <h2>Habit Tracker</h2>
    </div>
  );
}

export default Header;
